const Cart = ({cart}) => {
    return (
        <div id="shopping-cart">
            <div className="name_cart">Mi carrito</div>
            {
                () => {
                    if (cart.length == 0) 
                        return console.log("HOLA")
                    else
                        return console.log("ADIOS")
                }
            }
        </div>
    )
}

export default Cart;
